import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class MySerService {

  URL="https://localhost:7224/api/YadVashem/"

  constructor(private http:HttpClient) { }

  SendLocationServe(location:string):Observable<boolean>
  {
    return this.http.post<boolean>(this.URL + "SendLocationServe",location);
  }

  GetLocation():Observable<string>
  {
    return this.http.get<string>(this.URL + "GetLocation");
  }

}
